import React, { Component } from "react";
import useSWR from "swr";
import Link from "next/link";
import JobCardsLayout from "../components/JobsectionCards";

const fetcher = async (url) => {
  const res = await fetch(url);
  const data = await res.json();

  if (res.status !== 200) {
    throw new Error("error", data.message);
  }
  return data;
};

export default function FetchData() {
  const { data, error } = useSWR("/api/job/index", fetcher);
  console.log("Data:", data);

  if (error) return <div>Failed to load entry level api</div>;
  if (!data) return <div>Loading...</div>;

  // return data.map((res, index) => {
  //   const { job_position, company, location, url } = res;
  //   return (
  //     <article className="job-card" key={index}>
  //       <h1>{job_position}</h1>
  //       <h2>{company}</h2>
  //       <h2>{location}</h2>
  //     </article>
  //   );
  // });
  return (
    <JobCardsLayout title="Entry-level Jobs">
      {data.map((res, index) => {
        const { job_position, company, location, url } = res;
        <article className="job-card" key={index}>
          <h1>{job_position}</h1>
          <h1>{company}</h1>
          <h1>{location}</h1>
        </article>;
      })}
    </JobCardsLayout>
  );
}
